import React from 'react'
const SKMenu = () => {

    const gridStyle = {
        borderRadius: "10px",
        margin: "1em 1em 1em 1em",
        textAlign: "center",
        color: "#fff"
    }

    return (
        <div className="column has-background-info" style={gridStyle}>
            <span className="icon is-large">
                <i className="fas fa-mail-bulk fa-2x"></i>
            </span>
            <div>
                <h1 className="has-text-weight-bold">Surat Keluar</h1>
            </div>
        </div>
    )
}

export default SKMenu
